    var elapsed = this.elapsed += time - 0;
    this.percentage = (elapsed / this.timeframe).toFixed(2);
    this.tween.update(elapsed);

    //default
    var eventData = this.eventDefault("update");
    this.dispatch(eventData);

    //set to stop
    if(elapsed > this.timeframe) {
        this.end();
        return;
    }

